import React from 'react';
import { Link } from 'react-router-dom';
import './priceTier.css';

const PriceTierHeader = ({name, price, description, search, extension, second, bulk, templates, reply}) => {

  return (
    <div className='pricing__tier'>
      <h2 className='pricing__tier-name'>{name}</h2>
      <div className='pricing__tier-price_container'>
        <h3 className='pricing__tier-price'>${price}</h3>
        <p>/month</p>
      </div>

      <p>{description}</p>
      <div className='button__container'>
          <Link to='/message'>
            <button className='button'>
              Get Started
            </button>
          </Link>
        </div>
    </div>
  )
}

export default PriceTierHeader
